started.html.body:
Getting started

We will be using ES2015 in the code samples in the guide.

HTML




  {{ $t("message.hello") }}


JavaScript
// If using a module system (e.g. via vue-cli), import Vue and VueI18n and then call Vue.use(VueI18n).
// import Vue from 'vue'
// import VueI18n from 'vue-i18n'
//
// Vue.use(VueI18n)

// Ready translated locale messages
const messages = {
  en: {
    message: {
      hello: 'hello world'
    }
  },
  ja: {
    message: {
      hello: 'こんにちは、世界'
    }
  }
}

// Create VueI18n instance with options
const i18n = new VueI18n({
  locale: 'ja', // set locale
  messages, // set locale messages
})


// Create a Vue instanc with `i18n` option
new Vue({ i18n }).$mount('#app')

// Now the app has started!

Output the following:

  こんにちは、世界

formatting.html.body:
Formatting
HTML formatting

 NOTE: Dynamically localization arbitrary HTML on your website can be very dangerous because it can easily lead to XSS vulnerabilities. Only use HTML interpolation on trusted content and never on user-provided content. We recommended that use component interpolation feature.

In some cases you might want to rendered your translation as an HTML message and not a static string.
const messages = {
  en: {
    message: {
      hello: 'hello  world'
    }
  }
}

Template the below:


Output the below (instead of the message pre formatted)
hello
 exists but is rendered as html and not a string-->
world

Named formatting
Locale messages the below:
const messages = {
  en: {
    message: {
      hello: '{msg} world'
    }
  }
}

Template the below:
{{ $t('message.hello', { msg: 'hello' }) }}

Output the below:
hello world

List formatting
Locale messages the below:
const messages = {
  en: {
    message: {
      hello: '{0} world'
    }
  }
}

Template the below:
{{ $t('message.hello', ['hello']) }}

Output the below:
hello world

Support ruby on rails i18n format
Locale messages the below:
const messages = {
  en: {
    message: {
      hello: '%{msg} world'
    }
  }
}

Template the below:
{{ $t('message.hello', { msg: 'hello' }) }}

Output the below:
hello world

Custom formatting
Sometimes, you maybe need to translate with custom formatting (e.g. ICU message syntax).
You can realize with custom formatter that implement Formatter Interface.
The following custom formatter with ES2015 class syntax:
// Custom Fromatter implementaion
class CustomFormatter {
 constructor (options) {
   // ...
 }

 //
 // interpolate
 //
 // @param {string} message
 //   string of list or named format.
 //   e.g.
 //   - named formatting: 'Hi {name}'
 //   - list formatting: 'Hi {0}'
 //
 // @param {Object | Array} values
 //   values of `message` interpolcation.
 //   passed values with `$t`, `$tc` and `i18n` functional component.
 //   e.g. 
 //   - $t('hello', { name: 'kazupon' }) -> passed values: Object `{ name: 'kazupon' }` 
 //   - $t('hello', ['kazupon']) -> passed values: Array `['kazupon']`
 //   - `i18n` functional component (component interpolcation)
 //     
 //       kazupon
 //       how are you?
 //     
 //     -> passed values: Array (included VNode):
 //        `[VNode{ tag: 'p', text: 'kazupon', ...}, VNode{ tag: 'p', text: 'how are you?', ...}]`
 //
 // @return {Array}
 //   interpolated values. you need to return the following:
 //   - array of string, when is using `$t` or `$tc`.
 //   - array included VNode object, when is using `i18n` functional component.
 // 
 interpolate (message, values) {
   // implement interpolcation logic here
   // ...

   // return the interpolated array
   return ['resolved message string']
 }
}

// register with `formatter` option
const i18n = new VueI18n({
  locale: 'en-US',
  formatter: new CustomFormatter(/* here the constructor options */),
  messages: {
    'en-US': {
      // ...
    },
    // ...
  }
})

// Run!
new Vue({ i18n }).$mount('#app')

You can check the custom formatter official example.

pluralization.html.body:
Pluralization
You can translate with pluralization.  You must define the locale that have a pipe | separator, and define plurals in pipe separator.
Locale messages the below:
const messages = {
  en: {
    car: 'car | cars'
  }
}

Template the below:
{{ $tc('car', 0) }}
{{ $tc('car', 1) }}

Output the below:
car
cars

datetime.html.body:
DateTime localization

 7.0+

You can localize the datetime with your definition formats.
DateTime formats the below:
const dateTimeFormats = {
  'en-US': {
    short: {
      year: 'numeric', month: 'short', day: 'numeric'
    },
    long: {
      year: 'numeric', month: 'short', day: 'numeric',
      weekday: 'short', hour: 'numeric', minute: 'numeric'
    }
  },
  'ja-JP': {
    short: {
      year: 'numeric', month: 'short', day: 'numeric'
    },
    long: {
      year: 'numeric', month: 'short', day: 'numeric',
      weekday: 'short', hour: 'numeric', minute: 'numeric', hour12: true
    }
  }
}

As the Above, You can define the datetime format with named (e.g. short, long, etc), and you need to use the options with ECMA-402 Intl.DateTimeFormat
After that like the locale messages, You need to specify the dateTimeFormats option of VueI18n constructor:
const i18n = new VueI18n({
  dateTimeFormats
})

new Vue({
  i18n
}).$mount('#app')

Template the below:

  {{ $d(new Date(), 'short') }}
  {{ $d(new Date(), 'long', 'ja-JP') }}


Output the below:

  Apr 19, 2017
  2017年4月19日(水) 午前2:19

number.html.body:
Number localization

 7.0+

You can localize the number with your definition formats.
Number formats the below:
const numberFormats = {
  'en-US': {
    currency: {
      style: 'currency', currency: 'USD'
    }
  },
  'ja-JP': {
    currency: {
      style: 'currency', currency: 'JPY', currencyDisplay: 'symbol'
    }
  }
}

As the Above, You can define the number format with named (e.g. currency, etc), and you need to use the options with ECMA-402 Intl.NumberFormat
After that like the locale messages, You need to specify the numberFormats option of VueI18n constructor:
const i18n = new VueI18n({
  numberFormats
})

new Vue({
  i18n
}).$mount('#app')

Template the below:

  {{ $n(100, 'currency') }}
  {{ $n(100, 'currency', 'ja-JP') }}


Output the below:

  $100.00
  ￥100

messages.html.body:
Locale messages syntax
Structure
Locale Messages syntax the below:
// As Flowtype defnition, Locale Messages syntax like BNF annotation
type LocaleMessages = { [key: Locale]: LocaleMessageObject };
type LocaleMessageObject = { [key: Path]: LocaleMessage };
type LocaleMessageArray = LocaleMessage[];
type LocaleMessage = string | LocaleMessageObject | LocaleMessageArray;
type Locale = string;
type Path = string;

Based on the above syntax, You can configure the following structure Locale Messages:
{
  "en": {  // 'en' Locale
    "key1": "this is message1", // basic
    "nested": { // nested
      "message1": "this is nested message1"
    },
    errors: [ // array
      "this is 0 error code message",
      {  // array in object
         "internal1": "this is internal 1 error message"
      },
      [  // array in array
         "this is nested array error 1"
      ]
    ]
  },
  "ja": { // 'ja' Locale
    // ...
  }
}

In the above Locale Messages structure,  You can translate with using below key paths.


  {{ $t('key1') }}

  {{ $t('nested.message1') }}

  {{ $t('errors[0]') }}

  {{ $t('errors[1].internal1') }}

  {{ $t('errors[2][0]') }}


Ouput the following:


  this is message1

  this is nested message1

  this is 0 error code message

  this is internal 1 error message

  this is nested array error 1


Linked locale messages
If there's a translation key that will always have the same concrete text as another one you can just link to it. To link to another translation key, all you have to do is to prefix its contents with an @: sign followed by the full name of the translation key including the namespace you want to link to.
Locale messages the below:
const messages = {
  en: {
    message: {
      the_world: 'the world',
      dio: 'DIO:',
      linked: '@:message.dio @:message.the_world !!!!'
    }
  }
}

Template the below:
{{ $t('message.linked') }}

Output the below:
DIO: the world !!!!

fallback.html.body:
Fallback localization
The following locale messages that not exist message key in ja locale:
const messages = {
  en: {
    message: 'hello world'
  },
  ja: {
  }
}

When specify the fallbackLocale option to VueI18n constructor option, message key is localized with en locale key:
const i18n = new VueI18n({
  locale: 'ja',
  fallbackLocale: 'en',
  messages
})

Template the below:
{{ $t('message') }}

Output the below:
hello world

component.html.body:
Component based localization
In general, Locale info (e.g. locale,messages, etc) is set as constructor option of VueI18n instance, and it set  i18n option as root Vue instance. Thereby you globally can localize with using $t or $tc in the root Vue instance are composed some component. you manage  locale info for each component and it localize, it was better is convenient due to Vue is component oriented.
The following component based localization example:
// setup locale info for root Vue instance
const i18n = new VueI18n({
  locale: 'ja',
  messages: {
    en: {
      message: {
        hello: 'hello world',
        greeting: 'good morning'
      }
    },
    ja: {
      message: {
        hello: 'こんにちは、世界',
        greeting: 'おはようございます'
      }
    }
  }
})

// Define component
const Component1 = {
  template: `

     Component1 locale messages: {{ $t("message.hello") }}
     Fallback global locale messages: {{ $t("message.greeting") }}
   `,
  i18n: { // `i18n` option
    messages: {
      en: { message: { hello: 'hello component1' } },
      ja: { message: { hello: 'こんにちは、component1' } }
    }
  }
}

new Vue({
  i18n,
  components: {
    Component1
  }
}).$mount('#app')

Template the below:

  {{ $t("message.hello") }}



Output the below:

  こんにちは、世界

    Component1 locale messages: こんにちは、component1
    Fallback global locale messages: おはよう、世界！



As in the example above, if the component doesn't have the locale message, it  fallbacks and localizes global locale message. Also localize it using global locale (in the above example, locale: 'ja'). 
If you hope localize in the component locale, you can realize with sync: false and locale in i18n option.

interpolation.html.body:
Component interpolation

 7.0+

Sometimes, we need to localize with locale message that was included HTML tag or component. For example:
I accept xxx Terms of Service Agreement

In the above message, if you use with $t, probably you may try to compose the following locale messages:
const messages = {
  en: {
    term1: 'I Accept xxx\'s',
    term2: 'Terms of Service Agreement'
  }
}

And in the following, you may try to implement in template:
{{ $t('term1') }}{{ $t('term2') }}

output:
I accept xxx Terms of Service Agreement

This is very cumbersome, and if you configure the  tag in a locale message, there is a possibility XSS vulnerabilities due to localize with v-html="$t('term')".
You can avoid it with using i18n functional component. For example:



    {{ $t('tos') }}




const messages = {
  en: {
    tos: 'Term of Service',
    term: 'I accept xxx {0}.'
  },
  ja: {
    tos: '利用規約',
    term: '私は xxx の{0}に同意します。'
  }
}

const i18n = new VueI18n({
  locale: 'en',
  messages
})
new Vue({
  i18n,
  data: {
    url: '/term'
  }
}).$mount('#app')

the following ouput:



    I accept xxx Term of Service.




About the above example, see the example
The children of i18n functional component is interpolated with locale message of path prop. In the above example, {{ $t('tos') }} is interplated with term locale message.
The component interpolations follows the list formatting. The named formatting is not support. The children of i18n functional component is interpolated with order of list formatting.

sfc.html.body:
Single file component
If you are building Vue component or Vue application with using single file components, you can manage the locale messages i18n custom block.
The following in single file component example:

{
  "en": {
    "hello": "hello world!"
  },
  "ja": {
    "hello": "こんにちは、世界！"
  }
}




    locale

      en
      ja

    message: {{ $t('hello') }}




export default {
  name: 'app',
  data () { return { locale: 'en' } },
  watch: {
    locale (val) {
      this.$i18n.locale = val
    }
  }
}


You need to use vue-loader due to use i18n custom blocks, and the Webpack configration below is required:
module.exports = {
  // ...
  module: {
    rules: [
      {
        test: /\.vue$/,
        loader: 'vue-loader',
        options: {
          loaders: {
            // you need to specify `i18n` loaders key with `vue-i18n-loader` (https://github.com/kazupon/vue-i18n-loader)
            i18n: '@kazupon/vue-i18n-loader'
          }
        }
      },
      // ...
    ]
  },
  // ...
}

i18n custom blocks need to specify JSON format, also you can use YAML format by using pre-loader feature of vue-loader.
the i18n custom blocks below of YAML format:

en:
  hello: "hello world!"
ja:
  hello: "こんにちは、世界！"


Webpack conf the below:
module.exports = {
  // ...
  module: {
    rules: [
      {
        test: /\.vue$/,
        loader: 'vue-loader',
        options: {
          preLoaders: {
            i18n: 'yaml-loader'
          },
          loaders: {
            i18n: '@kazupon/vue-i18n-loader'
          }
        }
      },
      // ...
    ]
  },
  // ...
}

hot-reload.html.body:
Hot reloading
You can watch for changes in localization files and hot reload changes into your application.
// Something locale messages
const messages = {
  // ...
}

// VueI18n instance
const i18n = new Vuei18n({
  locale: 'en',
  messages
})

// Run app
const app = new Vue({
  i18n,
  // ...
}).$mount('#app')

// Hot updates
if (module.hot) {
  module.hot.accept(['./en', './ja'], function () {
    i18n.setLocaleMessage('en', require('./en').default)
    i18n.setLocaleMessage('ja', require('./ja').default)
    // Or the following hot updates via $i18n property
    // app.$i18n.setLocaleMessage('en', require('./en').default)
    // app.$i18n.setLocaleMessage('ja', require('./ja').default)
  })
}

migrations.html.body:
Migrations
Global config
lang replaced
Use VueI18n class constructor locale option, or VueI18n#locale property:
  const i18n = new VueI18n({
    locale: 'en',
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change locale
  i18n.locale = 'ja'
  // or
  app.$i18n.locale = 'ja'

fallbackLang replaced
Use VueI18n class constructor fallbackLocale option, or VueI18n#fallbackLocale property:
  const i18n = new VueI18n({
    locale: 'ja',
    fallbackLocale: 'en',
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change fallback locale
  i18n.fallbackLocale = 'zh'
  // or
  app.$i18n.fallbackLocale = 'zh'

missingHandler replaced
Use VueI18n class constructor missing option, or VueI18n#missing property:
  const i18n = new VueI18n({
    // ...
    missing: (locale, key, vm) => {
      // handle translation missing
    },
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change missing handler
  i18n.missing = (locale, key, vm) => {
    // handle translation missing
  }
  // or
  app.$i18n.missing = (locale, key, vm) => {
    // handle translation missing
  }

i18nFormatter replaced
Use VueI18n class constructor formatter option, or VueI18n#formatter property:
  class CustomFormatter {
    format (message, ...values) {
      // something render logic
      return 'something string'
    }
  }

  const i18n = new VueI18n({
    // ...
    formatter: new CustomFormatter(),
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change custom formatter
  i18n.formatter = {
    format: (message, ...values) => {
      // something render logic
      return 'something string'
    }
  }
  // or
  app.$i18n.formatter = {
    format: (message, ...values) => {
      // something render logic
      return 'something string'
    }
  }

Global methods
Vue.locale replaced
Use VueI18n class constructor messages option, or VueI18n#GetLocaleMessage / VueI18n#setLocaleMessage methods:
  const i18n = new VueI18n({
    // ...
    messages: {
      en: {
        hello: 'hello world',
        // ...
      },
      ja: {
        hello: 'こんにちは、世界',
        // ...
      }
    },
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // get locale message
  const en = i18n.getLocaleMessage('en')
  en.greeting = 'hi!'
  // set locale message
  i18n.setLocaleMessage('en', en)
  // or
  const ja = app.$i18n.getLocaleMessage('ja')
  ja.greeting = 'やあ！'
  app.$i18n.setLocaleMessage('ja', ja)

Vue.t replaced
Use VueI18n#t method:
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        greeting: 'hi {name}'
      }
    },
    // ...
  })

  i18n.t('greeting', { name: 'kazupon' }) // -> hi kazupon

Vue.tc replaced
Use VueI18n#tc method:
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        apple: 'no apples | one apple | {count} apples'
      }
    },
    // ...
  })

  const count = 10
  i18n.tc('apple', count, { count }) // -> 10 apples

Vue.te replaced
Use VueI18n#te method:
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        hello: 'hello world'
      }
    },
    // ...
  })

  i18n.te('hello') // -> true
  i18n.te('hallo', 'ja') // -> false
  i18n.te('hello') // -> true

Constructor options
locales replaced
Use messages of VueI18n class constructor option, or messages of i18n option (for Component option):
  const i18n = new VueI18n({
    locale: 'en',
    messages: {
      en: {
        greeting: 'hi {name}'
      }
    },
    // ...
  })

  // for Component
  const Component1 = {
    i18n: {
      messages: {
        en: {
          title: 'Title1'
        }
      }
    }
  }

Instance properties
$lang replaced
Use VueI18n#locale property:
  const i18n = new VueI18n({
    locale: 'en',
    // ...
  })
  const app = new Vue({ i18n }).$mount('#app')

  // change locale
  i18n.locale = 'ja'
  // or
  app.$i18n.locale = 'ja'

Features
Dynamic locale removed
If you need to dynamic set locale messages, you should implement the below:
  const i18n = new VueI18n({ locale: 'en' })
  const app = new Vue({
    i18n,
    data: { loading: '' }
  }).$mount('#app')

  function loadLocaleMessage (locale, cb) {
    return fetch('/locales/' + locale, {
      method: 'get',
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      }
    }).then((res) => {
      return res.json()
    }).then((json) => {
      if (Object.keys(json).length === 0) {
        return Promise.reject(new Error('locale empty !!'))
      } else {
        return Promise.resolve(json)
      }
    }).then((message) => {
      cb(null, message)
    }).catch((error) => {
      cb(error)
    })
  }

  app.loading = 'loading ...'
  loadLocaleMessage('en', (err, message) => {
    if (err) {
      app.loading = ''
      console.error(err)
      return
    }
    i18n.setLocaleMessage('en', message)
    app.loading = ''
  })
